import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Css/Menubar.css';
import { useNavigate } from 'react-router-dom';
import { Modal, Button } from 'react-bootstrap';
export default function MenuBar() {
const navigate = useNavigate();
const [show,setshow] = useState(false);
const [modalcontent,setmodalcontent] = useState({ title: '', action: ''});

 const handleshow = (title, action) => {
    setmodalcontent({title,action});
    setshow(true);
 }

  const handlenavgiation = (title) => {
    if(title === 'whitelist')
    {
        navigate('./PageComponent')
    } else {
        navigate('./ContactNavBar')
    }
  }
    return (
        <div className='MenuBar-Container'>
            <nav className="navbar navbar-expand-lg navbar-dark bg-dark"> {/* Endret til navbar-dark og bg-dark */}
                <div className="container">
                    <div className="row">
                   
                    </div>
                </div>
            </nav>
        </div>
    );
}
